import React from 'react'
import classes from './DibsBet.css'

const DibsBet = props =>(   
    <div>
        {
            props.userDibsBet.map((bet, index)=>{
                console.log(bet);
                switch(bet){
                    case 200: 
                    return(
                        <div key={index} className={classes.dib_200 + ' ' + classes.user_dib_200}>
                            {bet}
                        </div>
                    )
                    case 100: 
                    return(
                        <div key={index} className={classes.dib_100 + ' ' + classes.user_dib_100}>
                            {bet}
                        </div>
                    )
                    case 50: 
                    return(
                        <div key={index} className={classes.dib_50 + ' ' + classes.user_dib_50}>
                            {bet}
                        </div>
                    )
                    case 25: 
                    return(
                        <div key={index} className={classes.dib_25 + ' ' + classes.user_dib_25}>
                            {bet}
                        </div>
                    )
                    case 5: 
                    return(
                        <div key={index} className={classes.dib_5 + ' ' + classes.user_dib_5}>
                            {bet}
                        </div>
                    )
                    case 1: 
                    return(
                        <div key={index} className={classes.dib_1 + ' ' + classes.user_dib_1}>
                            {bet}
                        </div>
                    )
                }
            })
        }
        {
            props.enemyDibsBet.map((bet, index)=>{
                return(
                    <div key={index} className={'dib_' + bet + ' enemy_dib_' + bet}>
                        {bet}
                    </div>
                )
            })
        }
    </div>
)

export default DibsBet
